eld code="a">Read by Jay Ben Markson.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">Imagine everyone's surprise when Carter von Oehson, a sophomore in Dr. Dylan Reinhart's Abnormal Psychology class, posts on Instagram that he plans to kill himself. 24 hours later and still no one has seen him. Release the hounds.&amp;#x00A0;A massive search ensues. But when Carter's sailboat rolls in with the tide without him or anyone else on it, the worst seems to be confirmed. He really did it. Or did he?&amp;#x00A0;The one person convinced he's still alive is his father, Mathias von Oehson, founder and CEO of the world's largest hedge fund. But what Mathias knows and how he knows it would ultimately reveal a secret so damaging that it would be as if he were committing suicide himself. There's no way he can go to the police. But there's still someone he can turn to. Dylan now finds himself wrapped up in multi-million-dollar secrets and danger and it's going to take every bit of his wit, and the brilliant and headstrong NYPD Detective, Elizabeth Needham, to stay ahead of both his enemy, and his employer.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Suspense / Thriller.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Audiobooks.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Fiction.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Roughan, Howard</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Markson, Jay Ben</subfield></datafield><datafield tag="856" ind1="7" ind2=" "><subfield code="3">View cover art</subfield><subfield code="u">https://thumbnail.midwesttape.com/14185365_180.jpg</subfield><subfield code="2">https</subfield></datafield><datafield tag="962" ind1=" " ind2=" "><subfield code="b">BR1</subfield><subfield code="p">39.99</subfield><subfield code="q">1</subfield></datafield><d