<datafield tag="538" ind1=" " ind2=" "><subfield code="a">DVD.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English audio; French, Spanish subtitles.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English subtitles for the deaf and hard of hearing.</subfield></datafield><datafield tag="521" ind1="8" ind2=" "><subfield code="a">MPAA rating: PG-13.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">In his acclaimed debut as a filmmaker, Ahmir 'Questlove' Thompson presents a powerful and transporting documentary, part music film, part historical record, created around an epic event that celebrated Black history, culture, and fashion. Over the course of six weeks in the summer of 1969, just one hundred miles south of Woodstock, The Harlem Cultural Festival was filmed in Mount Morris Park (now Marcus Garvey Park). The footage was largely forgotten, until now. This documentary shines a light on the importance of history to our spiritual well-being and stands as a testament to the healing power of music during times of unrest, both past, and present. The feature includes concert performances by Stevie Wonder, Nina Simone, Sly &amp; the Family Stone, Gladys Knight and the Pips, Mahalia Jackson, B.B. King, The 5th Dimension, and more.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Music.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Documentary.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Documentary.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Wonder, Stevie</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Simone, Nina</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Sly &amp; The Family Stone, </subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Gladys 